Cita: </div><div class="citacuerpo">Bueno, más allá del post quería contar una cosa que me pasó y que de la alegría la quiziera compartir con ustedes, por más que a la mayoría le chupe un huevo lo cual es entendible&nbsp; :mrgreen: Resulta que hace exactamente una semana, es decir, el jueves pasado, me habló por teléfono Osvaldo Civile (es el ahijado de Osvaldo Civile de Horcas y el loco lleva su nombre) y me comentó que buscaban un bajista para una banda de thrash que está tocando temas de los 2 primeros discos de horcas y temas propios, más covers de otras bandas. Hoy fuí a la sala de ensayo, como quedamos y después de 2 horas de ensayos y de repasar temas como Ardiendo En Llamas, Marcha De Las Ratas, Cosas Enfermas, Reinará La Tempestad, Master Of Puppets, Hith The Lights, Fucking Hostile, Walk, Creeping Death entre otros, los muchachos me comunicaron un total agrado y entré a la banda, de nombre Hordas.<br />La felicidad me desborda en este momento, ya que aparte de esto, estaremos tocando el 25 de Febrero en Rafaela, Sta fé. con Metralla y Hachas (banda dónde está Ganzo y Benítez del primer Horcas) y tal vez se confirme una fecha con Logos acá en Córdoba a fín de año, algo impensado para mí hasta hoy&nbsp; :alaba:<br />Gracias a todos lo muchacho de la H por leer este off topic del post, que como dije antes, es solo para transmitir esta alegría que tengo, un abrazo y thrash till death&nbsp; :megaforce:</div></blockquote>...]]>
