			<title><![CDATA[Fan de MEGADETH arrestado por amenazas en línea]]></title>
			<link>http://hangar18.com.ar/?topic=23925</link>
			<description><![CDATA[<blockquote><div class="cita">Cita: </div><div class="citacuerpo">Notica oficial en ingles: <b><font color="#ff0000">Para Ver los enlaces debes estar Registrado asi que por favor:</font></b><br /><a href="http://hangar18.com.ar/index.php?action=registrarse">Registrate</a>&nbsp;o&nbsp;<a href="http://hangar18.com.ar/index.php?action=login">Identificate</a><div style="visibility:hidden">Blabbermouth.net</div></div></blockquote><blockquote><div class="cita">Cita: </div><div class="citacuerpo">&quot;Esta traducida por mi &nbsp;<img src="http://hangar18.com.ar/Smileys/default/icon_cool.gif" alt="" border="0" /> &quot;</div></blockquote><br /><div align="center"><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://imagehosting.guitarristas.info/28034ac28aa39f97b.jpg" border="0" /><br /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://www.roadrunnerrecords.com/blabbermouth.net/images/blabbernet_logo.gif" border="0" /><br /></div><br />Según Vancouver Sun un hombre, de 44 años de edad, de Appleton, Wisconsin fue arrestado por cargos de uso ilegal de los sistemas de comunicación informáticos y conducta desordenada después de solicitar una canción de MEGADETH a través de la sala de chat un programa de radio por Internet de Windsor, Ontario, con sede en Canadá.<br /><br />Trevor Fenton y Ryan Pat, los anfitriones de &quot;The MeltDown Show&quot; en HardRockRadioLive, estaban tomando pedidos de canciones el martes por la tarde, cuando un oyente registrado en sala de chat, de la estación, como: &quot;Watch_The_National _new_tomorrow_ I_am_going _to_go _A_ shooting_spree_ in_Appleton_WI&quot;. [Mira la futura noticia nacional, voy a ir a un tiroteo en Appleton Wsconsin&quot;.]<br /><br />El oyente pidió a los anfitriones reproducir la pista MEGADETH &quot;Killing Is My Business... And Business Is Good&quot;, escrito que sería, &quot;buena música para ponerse exptremadamente enojado y matar a un monton de gente.&quot; <br /><br />&quot;Tuvimos que tomar esta amenaza en serio, no podiamos ignorarlo. Eso fue algo que simplemente no podía pasar por alto y no ser reportado&quot;, dijo Ryan. &quot;Podría haber sido una broma. Pero si hablaba en serio y algo sucedía, yo no habría podido vivir conmigo mismo.&quot; <br /><br />Fenton se contactó con el Departamento de Policía de Appleton y ayudó a un oficial a identificar al hombre mediante el seguimiento de una dirección IP - una serie de numeros que todos los dispositivos de Internet tienen para comunicarse unos con otros - a un ordenador en una biblioteca pública. <br /><br />&quot;Creo que tendría que aceptar que en la época en que estamos viviendo, cada vez que hay amenazas como esta... tenemos que tomarlas en serio&quot;, dijo el sargento de la policía de Appleton, Pat DeWall. &quot;Incluso si esta persona no tiene un pasado violento, hay que asumir siempre lo peor y esperar lo mejor.&quot;<br /><br /><div align="center"><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://irongrave.files.wordpress.com/2010/04/cover81.jpg" border="0" /><br /><br /><object width="425px" height="350px"><param name="movie" value="http://www.youtube.com/v/vA7VoNLzySA&rel=0&fs=1&version=3" /><param name="wmode" value="transparent" /><param name="allowScriptAccess" value="always" /><param name="allowFullScreen" value="true"></param><embed src="http://www.youtube.com/v/vA7VoNLzySA&rel=0&fs=1&version=3" type="application/x-shockwave-flash" allowScriptAccess="always" wmode="transparent" allowfullscreen="true" width="425px" height="350px"></embed><br><a href="http://www.youtube.com/watch?v=vA7VoNLzySA" target="_blank">ENLACE</a></object><br /></div>...]]>
			</description>
