			<description><![CDATA[<span style="font-family: Georgia;"><span style="font-size: 12pt; line-height: 1.3em;"><span style="font-family: Georgia;"></span></span></span><div style="text-align: right;">Mi Primer Post Espero Hacerlo BienBueno Ahí Vamos<br /></div><br /><br />Cuantos de nosotros hemos descargado alguna placa de nuestra banda favorita, y al arrastra los archivos Mp3s al reproductor, nos percatamos que están llenos de datos, a estos datos se los suele llamar Etiquetas ID3 su función es agregar Información sobre el artista como por Ej:(nombre del álbum, año del lanzamiento, Genero etc.).<br /><br />Esta información es útil y bien recibida <b>PERO</b>en algún que otro caso esta información es manipulada erróneamente y lo que es peor aún, algunos Fulanos Intentan comercializar y aprovechan este medio para dejar datos inútiles de cómo poder contactarlos como por Ej: e-mail, sitios webs, teléfonos, etc.<br /><br />Entonces necesitamos de alguna forma poder editar estas Etiquetas. Una posible solución seria un programita llamado: <b>Dr TAG - v 1.95</b>. Lo pueden descargar del siguiente enlace: [<span style="color: blue;">url]http://www.mediafire.com/?uysp96i5kyg6inr[/url]</span> yo me tome el trabajo de subirlo a Mediafire y hacerlo Portable (Así haciendo doble click ya este funcionando sin tener que instalarlo).<br /><br />Ahora explicaré como realizar algunos trabajos, aclaro que no conozco al 100% el prog quizás tengan algunas funciones que desconozco pero yo me limito a utilizar las que supongo mas útiles.<br /><br /><br /><span style="text-decoration: underline;"><b>ADVERTENCIA</b></span>: Al ejecutar el prog este escanea las unidades de almacenamiento en busca de archivo .Mp3, operación que puede demorar algunos minutos y conviene detener la exploración rápidamente, haciendo click en el icono redondo de color rojo con la letra X en el centro.<br />Quedarse tranquilos no es nada peligroso.<br /><br /><br /><br /><div align="center"><b>&gt;&gt; ELIMINAR ETIQUETAS &lt;&lt;</b></div><br /><br />* Buscar y seleccionar los archivos Mp3s.<br /><br />* Después hacemos click con el botón secundario dentro de la selección y del menú desplegado,<br />elegimos la opción <b>N° 17: REMOVE ID3 V1</b>.<br /><br />* Luego Seleccionamos nuevamente los archivos Mp3s, hacemos click con el botón secundario y del menú desplegado, elegimos la opción <b>N° 18: REMOVE ID3 V2.</b><br /><br />* Por ultimo guardamos los cambios producido, haciendo click en el pequeño icono<br />con la figura de un diskette.<br /><br /><br /><br /><span style="text-decoration: underline;"><b>NOTA:</b></span> Algunos dispositivos utilizan las etiquetas para poder ordenar los archivos Mp3.<br />en el caso que no las tuvieran, los dispositivos no lo registran y los denominan:<br />Artistas Desconocido en Ingles: <b>UNKNOWN ARTIST</b>.<br /><br /><br /><br /><div align="center"><b>&gt;&gt; EDITAR ETIQUETAS &lt;&lt;</b></div><br /><br />* Buscar y seleccionar los archivos Mp3s.<br /><br />* Después hacemos click con el botón secundario dentro de la selección y del menú desplegado,<br />elegimos la opción N° 9: <b>EDIT ID3 V1 TAG.</b><br /><br />* Ahora dentro del pequeño cuadro desplegado, podremos agregar los datos necesarios<br />en sus casilleros y al finalizar hacemos click en el botón <b>OK.</b><br /><br />* Seleccionamos nuevamente los archivos Mp3s, hacemos click con el botón secundario y del menú desplegado, elegimos la opción N° 7:<b> ID3v1 - &gt; ID3v2</b>.<br /><br /> Finalizamos guardando los cambios producido, haciendo click en el pequeño icono<br />con la figura de un diskette.<br /><br /><br /><span style="text-decoration: underline;"><b>NOTA</b></span>: Recomiendo editar las etiquetas de los archivos Mp3s en el disco rígido, y Después Copiar a un dispositivo por Ej: reproductores portátiles, celulares etc. Ya que si editan y guardan los cambios desde la memoria del dispositivo el proceso seria algo lerdo.<br /><br /><br />Para ir finalizando. Solo espero que el prog o la guía, sean de ayuda a todos aquellos que se toparon con el mismo inconveniente. Comento que no soy un tipo muy Sabio pero investigo y aunque no sea mucho quisiera compartirlo.<br />AHH! casi me olvido a continuación dejo algunas capturas de pantallas para explicar en detalle los procesos explicados anteriormente.<br /><br /><br /><div style="text-align: right;">Sin nada más que decircreo y a la espera de prontos comentarios,<br />Saluda desde <b>Villa Mercedes</b> pro <b>San Luis</b> wwwjavier<span style="font-family: Georgia;"><span style="font-family: Georgia;"><span style="font-family: Georgia;"><span style="font-size: 18pt; line-height: 1.3em;"></span></span></span></span><br /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i.imgur.com/mJWZs.jpg" border="0" /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i.imgur.com/irP2t.jpg" border="0" /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i.imgur.com/8GkA7.jpg" border="0" /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i.imgur.com/L9vPM.jpg" border="0" /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i.imgur.com/NJwfV.jpg" border="0" /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i.imgur.com/dOo0W.jpg" border="0" /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i.imgur.com/WddPI.jpg" border="0" /><br /><br /><br /><br /><br /><br /><br /></div>...]]>
			</description>
